export default (function(a,b,c,d,e,f,g,h,i){return {data:{yNri2kYrdi:{data:{id:1224,attributes:{imdbId:"tt0109890",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNGY5YjhmMjYtMGMwZS00ZjUyLTk1NWMtNTA5YWVhM2I5MjE1XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.8\u002F10"},{Source:"Rotten Tomatoes",Value:"30%"},{Source:"Metacritic",Value:"51\u002F100"}],item_lang:{data:{id:1887,attributes:{title:d,plot:"Doc McCoy is put in prison because his partners chickened out and flew off without him after exchanging a prisoner with a lot of money. Doc knows Jack Benyon, a rich \"business\"-man, is up to something big, so he tells his wife (Carol McCoy) to tell him that he's for sale if Benyon can get him out of prison. Benyon pulls some strings and Doc McCoy is released again. Unfortunately he has to cooperate with the same person that got him to prison.",slug:"the-getaway"}}},books:{data:[{id:6774,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:true,published:g,publisher:h,subtitle:a}},{id:6775,attributes:{title:d,description:e,thumbnail:f,authors:[b],firstBook:c,published:g,publisher:h,subtitle:a}},{id:6776,attributes:{title:"The Getaway. Reprinted",description:a,thumbnail:a,authors:[b],firstBook:c,published:"1973-01-01",publisher:a,subtitle:a}},{id:6777,attributes:{title:i,description:"Doc McCoys skicklighet som brottsling vet nästan inga gränser. Men inte ens för McCoy finns det något sådant som ett perfekt bankrån - inte utan en perfekt flykt. På grund av en förrädisk och klumpig partner får bankrånet i stället förödande konsekvenser. Ett enda litet misstag kastar Doc McCoy rakt in i ett helvete präglat av blod, svek och kaos - till brädden fyllt av våld och bristande lojaliteter - där ingen handling är utan baktanke. Getaway är boken som alla andra bankrånsskildringar måste mäta sig mot. Såväl Steve McQueen och Alec Baldwin har axlat rollen som Doc McCoy på vita duken. Men det är mest av allt Jim Thompsons mörka, skitiga prosa som gör Getaway till ett sådant mästerverk i sin genre. I översättning av Inge R. L. Larsson. JIM THOMPSON [1906-1977] föddes i Anadarko, Oklahoma. Han har skrivit ett trettiotal böcker och räknas, tillsammans med Raymond Chandler och James Ellroy, som en av de främsta - och mest hårdkokta - noirförfattarna genom tiderna. Modernista ger nu ut Jim Thompsons två största klassiker: Getaway från 1958 och Grifters från 1963.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=CgxMDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2017-11-07",publisher:"Modernista",subtitle:a}},{id:6778,attributes:{title:i,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=J7GyswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1992-01-01",publisher:a,subtitle:"Kriminalroman"}}]}}},meta:{}}},prerenderedAt:1680940977051}}("","Jim Thompson",null,"The Getaway","Doc McCoy is the most skilled criminal alive. But when for the first time in Doc's long criminal career, his shot doesn't hit the mark, everything begins to fall apart. And Doc begins to realize that the perfect bank robbery isn't complete without the perfect getaway to back it up. THE GETAWAY is the classic story of a bank robbery gone horribly wrong, where the smallest mistakes have catastrophic consequences, and shifting loyalties lead to betrayals and chaos. The basis for the classic Steve McQueen film of the same name, as well as a 1994 remake with Alec Baldwin, Thompson's novel set the bar for every heist story that followed--but as Thompson's proved time and again, nobody's ever done it better than the master.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gI5cDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-12-25","Hachette UK","Getaway"))